import React,{useState} from 'react'
import {useNavigate} from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.css'

const Signup = () => {
  const navigate = useNavigate();
  const [user,setUser] =useState({name:"",email:"",password:"",cpassword:"",tyUser:"",AdminEmail:""});

  let name,value;
  const handelInput = (e)=>
  {
    name=e.target.name;
    value=e.target.value;
    setUser({...user,[name]:value});
  }

  const ch = (e) =>
  {
    AdminEmail.hi
    name=e.target.name;
    value=e.target.value;
    if(value)value=0;
    else value=1;
    setUser({...user,[name]:value});
    
  }

  const PostData = async (e) =>{
    e.preventDefault();
    const {name,email,password,cpassword,tyUser,AdminEmail} =user;

    const res= await fetch('/register' , {
      method:"POST",
      headers:{
        "Content-Type":"application/json"
      },
      body:JSON.stringify({
        name,email,password,cpassword,tyUser
      })
    });
    const data = await res.json();
    if ('message' in data)
    {
      window.alert('Registration Successfully');
      navigate("/SignIn");
    }
    else 
    {
      window.alert(data["error"]);
    }
  }
  return (
    <>
      <section className="vh-100" style={{"background-color": "#eee" }} >
        <div className="container ">
          <div className="row d-flex justify-content-center align-items-center h-100">
            <div className="col-lg-12 col-xl-11"  style={{"marginTop":"25px"}}>
              <div className="card text-black" style={{"border-radius": "25px"}}>
                <div className="card-body p-md-0">
                  <div className="row justify-content-center">
                    <div className="col-md-10 col-lg-6 col-xl-5 order-2 order-lg-1">

                      <p className="text-center h1 fw-bold mb-5 mx-1 mx-md-4 mt-4">Sign up</p>

                      <form method='post' className="mx-1 mx-md-4">

                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-user fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input value={user.name} onChange={handelInput} name="name" type="text" id="form3Example1c" className="form-control" />
                            <label className="form-label" for="form3Example1c">Your Name</label>
                          </div>
                        </div>

                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-envelope fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input value={user.email} onChange={handelInput} name="email" type="email" id="form3Example3c" className="form-control" />
                            <label className="form-label" for="form3Example3c">Your Email</label>
                          </div>
                        </div>

                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-lock fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input value={user.password} onChange={handelInput} name="password" type="password" id="form3Example4c" className="form-control" />
                            <label className="form-label" for="form3Example4c">Password</label>
                          </div>
                        </div>

                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-key fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input value={user.cPassword} onChange={handelInput} name="cpassword" type="password" id="form3Example4cd" className="form-control" />
                            <label className="form-label" for="form3Example4cd">Repeat your password</label>
                          </div>
                        </div>



                      



                        <div className="form-check d-flex justify-content-center mb-5">
                          <input  className="form-check-input me-2" type="checkbox" name="tyUser" value={user.tyUser}  onChange={ch} id="form2Example3c" />
                          <label className="form-check-label" for="form2Example3">
                            SignUp as a Admin
                          </label>
                        </div>


                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-key fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input value={user.AdminEmail} onChange={handelInput} name="AdminEmail" type="password" id="form3Example4cd" className="form-control" />
                            <label className="form-label" for="form3Example4cd">Repeat your password</label>
                          </div>
                        </div>


                        <div className="d-flex justify-content-center mx-4 mb-3 mb-lg-4">
                          <button type="button" onClick={PostData} className="btn btn-primary btn-lg">Register</button>
                        </div>

                      </form>

                    </div>
                    <div className="col-md-10 col-lg-6 col-xl-7 d-flex align-items-center order-1 order-lg-2">

                      <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-registration/draw1.webp" className="img-fluid" alt="error" />

                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  )
}

export default Signup
